    public static String EXIT_MESSAGE = "<html><head><style type=\"text/css\">p {font-family: courier}p.sansserif {font-family: sans-serif}</style></head><p>Prezado Contribuinte</p><br><p>Este emissor <b>n\u00e3o deve</b> ser utilizado como reposit\u00f3rio das NF-e emitidas.</p><br><p><b>Aten\u00e7\u00e3o:</b> cada NF-e autorizada pela SEFAZ deve ser exportada e armazenada em local seguro, fora do Emissor de NF-e, pelo prazo exigido pela legisla\u00e7\u00e3o tribut\u00e1ria, para exibi\u00e7\u00e3o ao fisco, quando for solicitado. Esta NF-e exportada \u00e9 o documento jur\u00eddico que deve ser enviado/disponibilizado ao seu cliente.</p><br><p>Para exportar uma NF-e <b>autorizada</b> pelo Emissor de NF-e:</p><p>&nbsp;&nbsp;1) Na tela de gerenciamento do Emissor da NF-e, ou na tela de detalhe da NF-e, clique em \"EXPORTAR\" e selecione \"ARQUIVO XML\" como o tipo de arquivo a ser gerado. Localize um diret\u00f3rio em que o arquivo ser\u00e1 exportado;</p><p>&nbsp;&nbsp;2) Ser\u00e1 gerado um arquivo cujo nome ser\u00e1 composto: pelo n\u00famero do protocolo de autoriza\u00e7\u00e3o (15 d\u00edgitos), seguido da vers\u00e3o do leiaute (ex: v1.10), e acrescentado com a express\u00e3o \"-procNFe\". Exemplo de nome de um arquivo de NF-e autorizado exportado: \"123456789012345_v1.10-procNFe\".</p><p>&nbsp;&nbsp;3) Este arquivo gerado dever\u00e1 ser armazenado pelo emitente pelo prazo decadencial e tamb\u00e9m dever\u00e1 ser enviado ao seu cliente. A forma deste envio ao seu cliente n\u00e3o est\u00e1 regulamentada pela legisla\u00e7\u00e3o, e poder\u00e1 ser feita da melhor forma segura comercialmente combinada entre o emitente e o destinat\u00e1rio.</p><br><p>Para visualizar as informa\u00e7\u00f5es da NF-e exportada, utilizar o aplicativo \"visualizador NF-e (SPED)\", dispon\u00edvel para download no site nacional da NF-e (www.nfe.fazenda.gov.br).</p><br><p>A NF-e autorizada cujo arquivo XML j\u00e1 foi exportado e armazenado em local seguro poder\u00e3o ser exclu\u00eddas do programa emissor de NF-e, para n\u00e3o sobrecarreg\u00e1-lo. Recomendamos que as exclus\u00f5es ocorram mensalmente ou em per\u00edodo menor, caso a quantidade de NF-e acarrete lentid\u00e3o no sistema.</p><br><p><b>Importante:</b> antes de excluir periodicamente as NF-e, proceda \u00e0s inutiliza\u00e7\u00f5es das faixas de numera\u00e7\u00e3o n\u00e3o utilizadas do per\u00edodo, bem como siga as orienta\u00e7\u00f5es sobre backup dispostas abaixo.</p><p>Recomendamos que o emitente realize <b>backup di\u00e1rio</b> de seus dados, como forma adicional de se precaver de eventual perda de informa\u00e7\u00f5es. O Backup <b>n\u00e3o substitui</b> a necessidade de exporta\u00e7\u00e3o das NF-e autorizadas; \u00e9 apenas uma forma adicional de preven\u00e7\u00e3o \u00e0 perda de seus dados.</p><br><p>Para realizar backup:</p><p>&nbsp;&nbsp;1) Saia do emitente atual (Op\u00e7\u00e3o \"Emitente\" - \"Sair do Emitente Atual\")</p><p>&nbsp;&nbsp;2) Clicar em \"Sistema\" - \"Backup\";</p><p>&nbsp;&nbsp;3) Selecionar o diret\u00f3rio em que ser\u00e1 gravado o backup e clique em \"Iniciar\";</p><p>&nbsp;&nbsp;4) No backup ser\u00e1 gerado um arquivo zipado com o nome \"NFE_\" seguido do ano, m\u00eas, dia, hora e minuto da gera\u00e7\u00e3o. Exemplo de nome: \"NFE_200806011200.zip\", indicando que o arquivo foi gerado no ano 2008, m\u00eas 06, dia 01, \u00e0s 12 horas e 00 minutos.</p><br><p>O Emissor de NF-e disponibilizado pela Secretaria da Fazenda do Estado de S\u00e3o Paulo (SEFAZ/SP) \u00e9 apenas uma das formas dispon\u00edveis para gera\u00e7\u00e3o e transmiss\u00e3o de NF-e, e seu uso n\u00e3o \u00e9 obrigat\u00f3rio. O contribuinte poder\u00e1, alternativamente, adquirir ou desenvolver um sistema para este fim, sempre de acordo com o Manual vigente de Integra\u00e7\u00e3o do Contribuinte.</p><br></html>";
